(function(){console.log("Analytics loaded");const metrics={pageLoadTime:performance.now(),resources:performance.getEntriesByType("resource").length,startTime:Date.now(),interactions:0};window.addEventListener("beforeunload",function(){const timeSpent=(Date.now()-metrics.startTime)/1000;console.log("Page resources:",metrics.resources);console.log("Time spent on page:",Math.round(timeSpent),"seconds");console.log("User interactions:",metrics.interactions)});document.addEventListener("click",function(){metrics.interactions++})})(); 